    {
      title: '종료일',
      dataIndex: 'end_dt',
      key: 'end_dt',
    },
    {
      title: '키워드',
      dataIndex: 'keyword',
      key: 'keyword',
    },
    {
      title: '상태',
      dataIndex: 'status',
      key: 'status',
      render: (record: any) => <StatusTag table="request" status={record} />,
    },
    {
      title: '',
      key: 'action',
      render: (text: any, record: any) => (
        <>
          <span>
            <a onClick={() => editRequestClick(record)}>
              <Icon
                type="edit"
                theme="twoTone"
                twoToneColor="#52c41a"
                style={{ verticalAlign: 'middle' }}
              />
            </a>
            <Divider type="vertical" />
            <Popconfirm
              title="Are you sure?"
              icon={
                <Icon
                  type="question-circle-o"
                  style={{ color: 'red', verticalAlign: 'middle' }}
                />
              }
              okText="Yes"
              cancelText="No"
              onConfirm={() => deleteRequestClick(record)}
            >
              <a>
                <Icon
                  type="delete"
                  theme="twoTone"
                  twoToneColor="#6D6D6D"
                  style={{ verticalAlign: 'middle' }}
                />
              </a>
            </Popconfirm>
          </span>
        </>
      ),
    },
  ];

  const loadNodeDetailData = (request_seq: number) => {
    const nodeStore = new NodeStore();
    return nodeStore.nodeDetailData(request_seq).then(res => {
      return res.data;
    });
  };

  const expandedRowRender = (e: any) => {
    const request_seq = e.seq;
    const columns = [
      {
        title: 'seq',
        dataIndex: 'seq',
        key: 'seq',
        width: '5%',
      },
      {
        title: '시작일',
        dataIndex: 'start_dt',
        key: 'start_dt',
        width: '15%',
      },
      {
        title: '종료일',
        dataIndex: 'end_dt',
        key: 'end_dt',
        width: '15%',
      },
      {
        title: '상태',
        key: 'status',
        width: '15%',
        filters: [
          { text: 'working', value: 'Request' },
          { text: 'complete', value: 'Finished' },
          { text: 'error', value: 'Error' },
        ],
        onFilter: (value: any, record: any) => record.status.includes(value),
        render: (record: any) => (
          <StatusTag table="progress" status={record.status} />
        ),
      },
      {
        title: '에러메시지',
        dataIndex: 'error_msg',
        key: 'error_msg',
        width: '50%',
      },
      {
        title: '',
        key: 'action',
        render: (text: any, record: any) => (
          <span>
            <Popconfirm
              title="Are you sure?"
              icon={
                <Icon
                  type="question-circle-o"
                  style={{ color: 'red', verticalAlign: 'middle' }}
                />
              }
              okText="Yes"
              cancelText="No"
              onConfirm={() => deleteProgressClick(record)}
            >
              <a>
                <Icon
                  type="delete"
                  theme="twoTone"
                  twoToneColor="#6D6D6D"
                  style={{ verticalAlign: 'middle' }}
                />
              </a>
            </Popconfirm>
          </span>
        ),
      },
    ];

    return (
      <>
        <Async promise={loadNodeDetailData(request_seq)}>
          <Async.Loading>
            <div style={{ position: 'absolute', top: '50%', left: '50%' }}>
              <Spin size="large" />
            </div>
          </Async.Loading>
          <Async.Resolved>
            {data => {
              return (
                <Table
                  size="small"
                  columns={columns}
                  dataSource={data['data']}
                />
              );
            }}
          </Async.Resolved>
        </Async>
      </>
    );
  };

  const handleDateChange = (date: Date | null) => {
    console.log(date);
  };

  const [selectedDate, setSelectedDate] = useState(new Date());

  return (
    <>
      <Table
        className="components-table-demo-nested"
        columns={tableColumns}
        dataSource={eventsData}
        expandedRowRender={expandedRowRender}
      />
      <Modal
        title="Basic Modal"
        visible={visible}
        onOk={handleModalOk}
        onCancel={handleModalCancel}
        okText="Save"
        style={{ minWidth: 1000 }}
      >
        <TextField
          id="standard-basic"
          label="키워드"
          defaultValue={request['keyword']}
          style={{ marginTop: 16, marginBottom: 8 }}
        />
        <MuiPickersUtilsProvider utils={DateFnsUtils}>
          <KeyboardDatePicker
            disableToolbar
            variant="inline"
            format="yyyy-MM-dd"
            margin="normal"
            id="date-picker-inline"
            label="수집시작일"
            value={new Date(request['start_dt'])}
            onChange={handleDateChange}
            KeyboardButtonProps={{
              'aria-label': 'change date',
            }}
          />
          <KeyboardDatePicker
            disableToolbar
            variant="inline"
            format="yyyy-MM-dd"
            margin="normal"
            id="date-picker-inline"
            label="수집종료일"
            value={new Date(request['end_dt'])}
            onChange={handleDateChange}
            KeyboardButtonProps={{
              'aria-label': 'change date',
            }}
          />
        </MuiPickersUtilsProvider>
      </Modal>
      {/* <Dialog
        open={visible}
        onClose={handleModalCancel}
        aria-labelledby="form-dialog-title"
        maxWidth="md"
      >
        <DialogTitle id="form-dialog-title">{request['title']}</DialogTitle>
        <DialogContent>
          <TextField
            id="standard-basic"
            label="키워드"
            defaultValue={request['keyword']}
            style={{ marginTop: 16, marginBottom: 8 }}
