              }}
            />
          </MuiPickersUtilsProvider>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleModalCancel} color="primary">
            Cancel
          </Button>
          <Button onClick={handleModalOk} color="primary">
            Save
          </Button>
        </DialogActions>
      </Dialog> */}
    </>
  );
};

export { NodeTable };
